import React from 'react';
import '../Hero.css';
import heroImg from '../images/hero.jpg'; // Replace with your actual image path

function Hero() {
  return (
    <section className="hero">
      <div className="hero-frame">
        <img src={heroImg} alt="Hero" className="hero-image" />
      </div>
    </section>
  );
}

export default Hero;
